import React from "react";
import CsvGraphPlotter from "./CsvGraphPlotter"; // Import the CsvGraphPlotter component

const App = () => {
  return (
    <div
      style={{
        fontFamily: "Arial, sans-serif",
        height: "100vh", // Full viewport height
        margin: 0,
        padding: 0,
        backgroundImage: `url('/background.png')`, // Reference image from public folder
        backgroundSize: "cover", // Make the image cover the entire container
        backgroundRepeat: "no-repeat", // Prevent tiling
        backgroundAttachment: "fixed", // Keep the image fixed during scrolling
        backgroundPosition: "center", // Center the background image
      }}
    >
      <CsvGraphPlotter /> {/* Render the CsvGraphPlotter component */}
    </div>
  );
};

export default App;

